w in store</h2>\n<!-- /wp:heading -->\n\n<!-- wp:woocommerce/product-new {\"columns\":4,\"rows\":1} /--></div>\n<!-- /wp:woocommerce/empty-cart-block --></div>\n<!-- /wp:woocommerce/cart -->', 'Cart', '', 'publish', 'closed', 'closed', '', 'cart', '', '', '2024-02-19 11:32:14', '2024-02-19 11:32:14', '', 0, 'http://localhost/wc-store/index.php/cart/', 0, 'page', '', 0),
